class Solution:
    def gardenNoAdj(self, n: int, paths: List[List[int]]) -> List[int]:
        g = [[] for _ in range(n)]
        for x, y in paths:
            x, y = x - 1, y - 1
            g[x].append(y)
            g[y].append(x)

        ans = [0] * (n * 10)
        visited = [False] * (n * 10)
        for x in range(n):
            queue = [x]
            while queue:
                i = queue.pop(0)
                if visited[i]:
                    continue
                visited[i] = True
                seen = set()
                for y in g[i]:
                    if visited[y]:
                        seen.add(ans[y])
                for c in range(1, 5):
                    if c not in seen:
                        ans[x * 10 + i] = c
                        break
                for y in g[i]:
                    if not visited[y]:
                        queue.append(y)

        result = []
        for i in range(n):
            result.append(ans[i * 10])
        return result
